import React, { useCallback, useState } from 'react';
import { BrowserRouter as Router, Route, Redirect, Switch } from 'react-router-dom';
import AllTasks from './users/pages/AllTasks';
import NewTask from './places/pages/NewTask';
import CreatorTasks from './places/pages/CreatorTasks';
import MainNavigation from './shared/components/Navigation/MainNavigation';
import UpdateTask from './places/pages/UpdateTask';

const App = () => {

  let routes;

  routes = (
    <Switch>
      <Route path="/tasks/:taskId" exact>
        <CreatorTasks/>
      </Route> 
      <Route path="/tasks/create" exact>
        <NewTask/>
      </Route>
      <Route path="/tasks/update/:taskId" exact>
        <UpdateTask/>
      </Route> 
      <Redirect to="/tasks"></Redirect>
    </Switch>
  );

  return (
    <Router>
      <MainNavigation />
        <main>
          {routes}
        </main>
    </Router>
  );
};

export default App;
